import React from 'react';
import { Link } from 'react-router-dom';
import classes from './GroupSideBar.module.css';

const GroupSideBar = () => {
    const admins = [
        { id: 1, name: 'John Smith', role: 'Admin', avatarUrl: '#' },
        { id: 2, name: 'Sarah Johnson', role: 'Admin', avatarUrl: '#' }
    ];

    return (
        <div className={classes.mainContainer}>
            <div className={classes.container}>
                <h2 className={classes.title}>About Group</h2>
                <div className={classes.description}>
                    A community for tech enthusiasts to share knowledge, discuss latest trends, and connect with like-minded people.
                </div>
                <div className={classes.details}>
                    <div className={classes.detailItem}>
                        <strong>Public group</strong>
                        <span>Created April 2025</span>
                    </div>
                </div>
            </div>

            <div className={classes.container}>
                <h2 className={classes.title}>Group Admins</h2>
                <div className={classes.items}>
                    {admins.map((admin) => (
                        <div className={classes.item} key={admin.id}>
                            <div className={classes.avatarContainer}>
                                <img src={admin.avatarUrl} alt="avatar" className={classes.avatar}/>
                            </div>
                            <div className={classes.infoContainer}>
                                <Link to={`/users/${admin.id}`} className={classes.name}>
                                    {admin.name}
                                </Link>
                                <span className={classes.role}>{admin.role}</span>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default GroupSideBar;
